import { ArrowBackIosOutlined } from "@mui/icons-material"
import "./list.scss"

function list() {
  return (
    <div className="list">
        <span className="listTitle">Continue to Watch</span>
        <div className="wrapper">
            <ArrowBackIosOutlined/>
        </div>
    </div>
  )
}

export default list
